fn main(){
    let shc = "";
    let mut result = String::new();
    let mut i = 0;
    loop {
        if i > shc.len()-1{
            break;
        }
        let chunk = &shc[i..(i+2)];
        let mut n: u8 = chunk.parse::<u8>().unwrap();
        n += 45;
        result.push(n as char);
        i += 2;
    }
    println!("{}", result);
}
